async function main() {
  console.log(`Importing form for brand: ${BRAND_SLUG}`)

  const supabase = createAdminClient()

  const { data: brand, error: brandError } = await supabase.from("brands").select("id").eq("slug", BRAND_SLUG).single()

  if (brandError) {
    console.error(`Error fetching brand: ${brandError.message}`)
    return
  }

  if (!brand) {
    console.error(`Brand with slug "${BRAND_SLUG}" not found.`)
    return
  }

  console.log(`Found brand with ID: ${brand.id}`)

  try {
    const result = await importForm(brand.id, null, FORM_HTML)
    if (result.success) {
      console.log("Successfully imported form from HTML content.")
      console.log("Result:", JSON.stringify(result.form, null, 2))
    } else {
      console.error("Failed to import form:", result.error)
    }
  } catch (e) {
    console.error("An unexpected error occurred during import:", e.message)
  }
}

main()
